// Generate districtList array ["Bhai","Barclayville,...]; indices match those of districtCoords.features array
var districtList = [];
for (var i=0; i<districtCoords.features.length; i++) {
    districtList.push(districtCoords.features[i].properties.DNAME);
}

// Default to view of Rivercess and Grand Gedeh
var map = L.map('map').setView([6.5, -8.9], 7);

var legend = L.control({position: 'bottomright'});
var grades = { array:[] };

L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
    maxZoom: 18
}).addTo(map);

// control that shows state info on hover
var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info');
    this.update();
    return this._div;
};

info.update = function (props) {
    this._div.innerHTML = '<h4>Liberia</h4>' +  (props ?
        '<b>' + props.FIRST_CCNA + '</b><br />' + props.DNAME + '<br>' + props.varValue
        : 'Hover over a district');
};

info.addTo(map);

var geojson = L.geoJson(districtCoords, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);


$(document).ready(function(){

    // Zoom function
    $('#select_zoom').change(function(){
        switch($(this).val()) {
            case 'setView_RC':
                map.setView([5.9, -9.4], 9);
                break;
            
            case 'setView_GG':
                map.setView([6.0, -8.1], 9);
                break;
            
            case 'setView_LIB':
                map.setView([6.5, -8.9], 7);
                break;
        }
    });

    // On indicator change; update map
    $('#select_indicator').change(function(){
        setVarValue($(this).val());
        resetGrades(grades, 1, maxParam($(this).val())) // !!!!! switch out "1" for new min function !!!!!
        geojson.setStyle(style);
        updateLegend(map, legend, grades);
    });
    
});

// get color depending on population density value
function getColor(d, gradesArray) {
    return d >= gradesArray[4] ? '#800026' :
           d >= gradesArray[3] ? '#E31A1C' :
           d >= gradesArray[2] ? '#FD8D3C' :
           d >= gradesArray[1] ? '#FED976' :
           d >= gradesArray[0] ? '#FFEDA0' :
                      '#ffffff';
}

function style(feature) {
    return {
        weight: 1,
        opacity: 1,
        color: 'grey',
        dashArray: '3',
        fillOpacity: 0.7,
        fillColor: getColor(feature.properties.varValue, grades.array) // this is the property to manipulate
    };
}

function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        color: '#666',
        dashArray: '',
        fillOpacity: 0.7
    });

    if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }

    info.update(layer.feature.properties);
}

function resetHighlight(e) {
    geojson.resetStyle(e.target);
    info.update();
}

function zoomToFeature(e) {
    map.fitBounds(e.target.getBounds());
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
        click: zoomToFeature
    });
}

function setVarValue(varName){
    
    for (var i=0; i<districtCoords.features.length; i++) {
        if ( typeof districtData[districtList[i]] !== "undefined" ) {
            districtCoords.features[i].properties.varValue = districtData[districtList[i]][varName];
        }
    }
    
}

function updateLegend(map, legend, grades) {
    
    // !!!!! consider using quintiles instead of linear scale !!!!!
    // !!!!! account for percentages !!!!!
    
    try {
        legend.removeFrom(map);
    } catch(e) {} finally {
        
        legend.onAdd = function () {

            var div = L.DomUtil.create('div', 'info legend'),
                label, from, to, labels = [];

            for (var i = 0; i < grades.array.length-1; i++) {
                from = grades.array[i];
                to = grades.array[i + 1];
                    label = '<i style="background:' + getColor(from+1, grades.array) + '"></i> ' +
                        from + '&nbsp;&ndash;&nbsp;' + to;
                labels.push(label);
            }

            div.innerHTML = labels.join('<br>');
            return div;
        };

        legend.addTo(map);
        
    }
}

function roundDecimal(input, digits){
    return Math.round(input*(Math.pow(10,digits))) / Math.pow(10,digits);
}

function maxParam(param) {
    var max = 'init';
    for (x in districtData) {
        if (max === 'init' || districtData[x][param] > max) {
            max = districtData[x][param];
        }
    }
    return max;
    alert('max: ' + max);
}

function resetGrades(grades, min, max) {
    // Generate grades array; round based on "step size"
    var step = (max-min)/5;
    if (step<=1) {
        grades.array = [roundDecimal(min,1), roundDecimal(min+(1*step),1), roundDecimal(min+(2*step),1), roundDecimal(min+(3*step),1), roundDecimal(min+(4*step),1), roundDecimal(max,1)];
    } else {
        grades.array = [roundDecimal(min,0), roundDecimal(min+(1*step),0), roundDecimal(min+(2*step),0), roundDecimal(min+(3*step),0), roundDecimal(min+(4*step),0), roundDecimal(max,0)];
    }
}
